import HistoryIcon from '../assets/history.png';
import '../styles/history.css'

function HistoryComponent(){
    return(
        <div className="historyBox">
            <img 
                alt="history icon" 
                src={HistoryIcon}

            />
        </div>
    )
}
export default HistoryComponent;
